import React, { useState, useEffect, useContext } from "react";
import axios from "axios";
import { AuthContext } from "../../../context/AuthContext";
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from "recharts";
import { Container, Row, Col } from "reactstrap";

const BookingChart = () => {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState([]);
  const { token } = useContext(AuthContext);

  useEffect(() => {
    axios
      .get("http://localhost:8888/bookings/count-by-status-and-month", {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      })
      .then((response) => {
        const countsByStatusAndMonth = response.data;

        // Tạo đối tượng dữ liệu cho mỗi trạng thái
        const failedData = countsByStatusAndMonth["FAILED"];
        const pendingData = countsByStatusAndMonth["PENDING"];
        const successfulData = countsByStatusAndMonth["SUCCESSFUL"];

        setLoading(false);
        setData({ failed: failedData, pending: pendingData, successful: successfulData });
      })
      .catch((error) => {
        setLoading(false);
      });
  }, [token]);

  return (
    <Container>
      <Row className="justify-content-center mt-4">
        <Col xs="12" sm="8" md="6">
          {loading ? (
            <p>Loading...</p>
          ) : (
            <LineChart width={600} height={400} data={data.failed}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="count" stroke="red" name="FAILED" />
            </LineChart>
          )}
        </Col>
      </Row>
      <Row className="justify-content-center mt-4">
        <Col xs="12" sm="8" md="6">
          {loading ? (
            <p>Loading...</p>
          ) : (
            <LineChart width={600} height={400} data={data.pending}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="count" stroke="orange" name="PENDING" />
            </LineChart>
          )}
        </Col>
      </Row>
      <Row className="justify-content-center mt-4">
        <Col xs="12" sm="8" md="6">
          {loading ? (
            <p>Loading...</p>
          ) : (
            <LineChart width={600} height={400} data={data.successful}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="count" stroke="green" name="SUCCESSFUL" />
            </LineChart>
          )}
        </Col>
      </Row>
    </Container>
  );
};

export default BookingChart;
